    data: |
      SELECT DISTINCT - + ( cor0.col1 ) * col2 + - col2 + + col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q9625.out
    data: |
      -1331
      -1432
      -617
